#define get_objectFromUserdata(objType, L, idx, tag) (objType*)*((void**)luaL_checkudata(L, idx, tag))

#pragma mark - Support Functions and Classes

#pragma mark - Module Functions -

static int constants_matchingName(lua_State *L) {
    LuaSkin *skin = [LuaSkin sharedWithState:L] ;
    [skin checkArgs:LS_TSTRING, LS_TBOOLEAN | LS_TOPTIONAL, LS_TBREAK] ;
    NSString *match    = [skin toNSObjectAtIndex:1] ;
    BOOL     firstOnly = (lua_gettop(L) > 1) ? (BOOL)(lua_toboolean(L, 2)) : YES ;

    if (firstOnly) lua_pushnil(L) ; else lua_newtable(L) ;
    [I_KEYS enumerateObjectsUsingBlock:^(NSString *key, __unused NSUInteger idx, BOOL *stop) {
        if ([key containsString:match]) {
            [skin pushNSObject:key] ;
            if (firstOnly) {
                *stop = YES ;
            } else {
                lua_rawseti(L, -2, luaL_len(L, -2) + 1) ;
            }
        }
    }] ;

    return 1 ;
}

static int constants_matchingValue(lua_State *L) {
    LuaSkin *skin = [LuaSkin sharedWithState:L] ;
    [skin checkArgs:LS_TSTRING | LS_TNUMBER | LS_TBOOLEAN,
                    LS_TBOOLEAN | LS_TOPTIONAL,
                    LS_TBOOLEAN | LS_TOPTIONAL,
                    LS_TBREAK] ;
    NSObject *match    = [skin toNSObjectAtIndex:1] ;
    BOOL     firstOnly = (lua_gettop(L) > 1) ? (BOOL)(lua_toboolean(L, 2)) : YES ;
    BOOL     partial   = (lua_gettop(L) > 2) ? (BOOL)(lua_toboolean(L, 3)) : NO ;

    if (partial) [skin checkArgs:LS_TSTRING, LS_TBREAK | LS_TVARARG] ;

    NSString *matchAsString = partial ? (NSString *)match : nil ;

    if (firstOnly) lua_pushnil(L) ; else lua_newtable(L) ;
    [I_CONSTANTS enumerateKeysAndObjectsUsingBlock:^(NSString *key, NSObject *value, BOOL *stop) {
        BOOL found = partial ? NO : [value isEqualTo:match] ;
        if (partial && [value isKindOfClass:[NSString class]]) {
            found = [(NSString *)value containsString:matchAsString] ;
        }
        if (found) {
            [skin pushNSObject:key] ;
            if (firstOnly) {
                *stop = YES ;
            } else {
                lua_rawseti(L, -2, luaL_len(L, -2) + 1) ;
            }
        }
    }] ;

    return 1 ;
}

