#pragma mark - Lua<->NSObject Conversion Functions -
// These must not throw a lua error to ensure LuaSkin can safely be used from Objective-C
// delegates and blocks.

#pragma mark - Hammerspoon/Lua Infrastructure -

static int userdata_len(lua_State *L) {
    lua_pushinteger(L, (lua_Integer)I_KEYS.count) ;
    return 1 ;
}

static int userdata_index(lua_State *L) {
    LuaSkin *skin = [LuaSkin sharedWithState:L] ;

    if (lua_type(L, 2) == LUA_TSTRING) {
        NSString *key = [skin toNSObjectAtIndex:2] ;

        if ([key isEqualToString:@"_matchingValue"]) {
            lua_pushcfunction (L, constants_matchingValue) ;
        } else if ([key isEqualToString:@"_matchingName"]) {
            lua_pushcfunction (L, constants_matchingName) ;
        } else {
            [skin pushNSObject:I_CONSTANTS[key]] ;
        }
    } else if (lua_type(L, 2) == LUA_TNUMBER && lua_isinteger(L, 2)) {
        lua_Integer idx = lua_tointeger(L, 2) ;
        if (idx > 0 && idx <= (lua_Integer)I_KEYS.count) {
            [skin pushNSObject:I_KEYS[(NSUInteger)(idx - 1)]] ;
        } else {
            lua_pushnil(L) ;
        }
    } else {
        lua_pushnil(L) ;
    }
    return 1 ;
}

static int userdata_pairs_iter(lua_State *L) {
    LuaSkin *skin = [LuaSkin sharedWithState:L] ;
    NSString *key = [skin toNSObjectAtIndex:2] ;
    NSString *val = nil ;

    if (key) {
        NSUInteger idx = [I_KEYS indexOfObject:key] ;
        if (idx == NSNotFound) {
            key = nil ;
        } else {
            idx++ ;
            if (idx == I_KEYS.count) {
                key = nil ;
            } else {
                key = I_KEYS[idx] ;
            }
        }
    } else {
        key = I_KEYS.firstObject ;
    }
    if (key) {
        val = I_CONSTANTS[key] ;
        [skin pushNSObject:key] ;
        [skin pushNSObject:val] ;
        return 2 ;
    } else {
        lua_pushnil(L) ;
        return 1 ;
    }
}

static int userdata_pairs(lua_State *L) {
    lua_pushcfunction(L, userdata_pairs_iter) ;
    lua_pushvalue(L, 1) ;
    lua_pushnil(L) ;
    return 3 ;
}

static int userdata_tostring(lua_State* L) {
    LuaSkin *skin = [LuaSkin sharedWithState:L] ;
    [skin pushNSObject:[NSString stringWithFormat:@"%s: (%p)", USERDATA_TAG, lua_topointer(L, 1)]] ;
    return 1 ;
}

static int userdata_gc(lua_State* L) {
    get_objectFromUserdata(__bridge_transfer NSArray, L, 1, USERDATA_TAG) ;
    lua_pushnil(L) ;
    lua_setmetatable(L, 1) ;
    return 0 ;
}

