int luaopen_hs__asm_libiokit_constants(lua_State* L) {
    iokit_buildConstantsTable() ;
    I_KEYS = [I_CONSTANTS.allKeys sortedArrayUsingSelector:@selector(compare:)] ;

    luaL_newmetatable(L, USERDATA_TAG) ;
    luaL_setfuncs(L, userdata_metaLib, 0) ;
    lua_pop(L, 1) ;

    void** valuePtr = lua_newuserdata(L, sizeof(NSArray *)) ;
    *valuePtr = (__bridge_retained void *)I_KEYS ;
    luaL_getmetatable(L, USERDATA_TAG) ;
    lua_setmetatable(L, -2) ;
    return 1 ;
}
